import React from "react";
import cartImg from "../../imgs/shopping-cart.png";
import styled from "styled-components";

////////////////////////////////////////////////////////////////
////////////////////////////////////////////////////////////////
////////////////////////////////////////////////////////////////

const NavDiv = styled.div`
  display: flex;
  align-items: left;
  flex-direction: column;
  width: 100%;
  height: 100px;
  margin-top: 20px;
  border-top: 15px outset black;
`;
////////////////////////////////
const Logo = styled.div`
  display: flex;
  gap: 5px;
  padding: 6px;
  background-color: #f8f1f3;
`;
const LogoSpan = styled.span`
  font-size: 15px;
`;
////////////////////////////////
const NavList = styled.div`
  display: flex;
  width: 100%;
  height: 200px;
  justify-content: space-between;
`;
const NavListLeft = styled.div`
  display: flex;
  width: 50%;
  height: 45px;
  background-color: #f8f1f3;
  border-bottom: 1px solid black;
`;
const NavListRight = styled.div`
  display: flex;
  justify-content: flex-end;
  width: 50%;
  padding-right: 15px;
  background-color: #f8f1f3;
`;
const StyledLink = styled.a`
  background-color: #fee7ea6e;
  font-size: 14px;
  color: black;
  padding: 8px;
  filter: drop-shadow(0px 0px 25px #fee7eb);
  text-decoration: none;
  @media only screen and (max-width: 500px) {
    font-size: 10px;
  }
  :hover {
    color: rgba(0, 0, 0, 0.45);
  }
`;
////////////////////////////////////////////////////////////////
////////////////////////////////////////////////////////////////
////////////////////////////////////////////////////////////////
////////////////////////////////////////////////////////////////
////////////////////////////////////////////////////////////////

function Navbar() {
  return (
    <NavDiv>
      <Logo>
        <LogoSpan>L</LogoSpan>
        <LogoSpan>O</LogoSpan>
        <LogoSpan>G</LogoSpan>
        <LogoSpan>O</LogoSpan>
      </Logo>
      <NavList>
        <NavListLeft>
          <StyledLink href="">NEUHEITEN</StyledLink>
          <StyledLink href="">TOP BEWERTET</StyledLink>
          <StyledLink href="">SCHMUCK</StyledLink>
          <StyledLink href="">SHOPS</StyledLink>
          <StyledLink href="">ÃœBER UNS</StyledLink>
        </NavListLeft>
        <NavListRight>
          <img
            src={cartImg}
            width="30px"
            height="30px"
            style={{ opacity: 0.7 }}
          />
        </NavListRight>
      </NavList>
    </NavDiv>
  );
}

export default Navbar;
